import React from 'react';
import { 
  LineChart, 
  Line,
  YAxis,
  ResponsiveContainer
} from 'recharts';

const MyLineChart = (props) => {
  return (
    <ResponsiveContainer
      width={'100%'}
      height={'100%'}
    >
    <LineChart
      width={640}
      height={480}
      data={props.data}
    >
      <Line 
        type="monotone" 
        dataKey="engagement_level" 
        stroke="#f5f5f5" 
        strokeWidth='2'
        isAnimationActive={false}
        dot={false}
      />
      <YAxis 
        domain={['dataMin', 'dataMax']} 
        allowDataOverflow={true} 
        style={{
          fontSize: '1rem',
          fontFamily: 'Staatliches',
        }}  
      />
    </LineChart>
    </ResponsiveContainer>
  );
};

export default MyLineChart;
